import './App.css';
import Navbar from './components/Navbar';
import TextForm from './components/TextForm';

function App() {
  return (
    <>
    <Navbar title="TextUtils" aboutText="About" /> 
    {/* <Navbar/> ye default propType ke liye */}
    <div>
    <TextForm heading ="Enter the text to analyze below" />
    </div>
    </>
  );
}

export default App;
